class ImageDepth extends Pan.Component {
    beforeMount() {
        this.viewport = new Pan.Viewport();



        let widthOffset = this.viewport.width * .25;
        let heightOffset = this.viewport.height * .25;

        let iwidth = this.viewport.width + widthOffset;
        let iheight = this.viewport.height + heightOffset;

        console.log(iwidth, iheight, widthOffset, heightOffset);

        if (this.viewport.width > this.viewport.height) {

        }

        else {
            
        }




        this.props = {
            viewport : {
                width : this.viewport.width,
                height : this.viewport.height
            },

            image : {
                width : iwidth,
                height : iheight,
                woffset : widthOffset / 2,
                hoffset : heightOffset / 2
            }
        }
    }

    render() {
        return (
            Pan.createElement('div#background-layer', {
                style: {
                    width: this.viewport.width + 'px', 
                    height: this.viewport.height + 'px',
                    perspective : '180px'
                }
            }, [
                Pan.createElement('div.smart-object', [
                    Pan.createElement('div.smart-object', [
                        Pan.createElement('img.smart-object', {
                            style : {
                                transform : `translate3d(-${this.props.image.woffset}px, -${this.props.image.hoffset}px, 0px) rotateX(0.0) rotateY(0.0)`,
                            },
                            attrs : {
                                width : this.props.image.width,
                                height : this.props.image.height,
                                src :"data:image/jpeg;base64,"
                            }
                        })
                    ]),
                    // Pan.createElement('div.smart-object', [
                    //     Pan.createElement('img', {
                    //         attrs : {
                    //             src :"data:image/jpeg;base64,"
                    //         }
                    //     })
                    // ])
                ])
            ])
        )
    }
}